--*************************************
--Slowly changing dimension--**********
--*************************************
MERGE  itmidw.[tblCrfEventAnswers] AS targetCrfData
USING #sourceCrfData ss
	ON CONVERT(VARCHAR(100),targetCrfData.[sourceSystemFieldDataID]) = CONVERT(VARCHAR(100),ss.[sourceSystemFieldDataID])
		AND CONVERT(VARCHAR(100),targetCrfData.[sourceSystemFieldDataLabel]) = CONVERT(VARCHAR(100),ss.[sourceSystemFieldDataLabel])
		AND targetCrfData.crfVersionID = ss.crfVersionID
		AND targetCrfData.subjectID = ss.subjectID
		AND targetCrfData.eventCrfID = ss.eventCrfID
      	
WHEN MATCHED
	AND (
           ss.[sourceSystemFieldDataID] <> targetCrfData.[sourceSystemFieldDataID] OR  
           ss.[sourceSystemFieldDataLabel] <> targetCrfData.[sourceSystemFieldDataLabel] OR  
           ss.[eventCrfID] <> targetCrfData.[eventCrfID] OR  
           ss.[crfVersionID] <> targetCrfData.[crfVersionID] OR  
           ss.[fieldValue] <> targetCrfData.[fieldValue] OR  
           ss.[hadQuery] <> targetCrfData.[hadQuery] OR  
           ss.[openQuery] <> targetCrfData.[openQuery] OR  
           ss.[fieldValueOrdinal] <> targetCrfData.[fieldValueOrdinal] OR  
		   ss.[fieldID] <> targetCrfData.[fieldID] OR  
		   ss.[orgSourceSystemID] <> targetCrfData.[orgSourceSystemID] OR  
		   ss.[createDate] <> targetCrfData.[createDate] OR
		   ss.[createdBy] <> targetCrfData.[createdBy] 
	)
THEN UPDATE SET
           [sourceSystemFieldDataID] = ss.[sourceSystemFieldDataID]
           , [sourceSystemFieldDataLabel] = ss.[sourceSystemFieldDataLabel]
           , [eventCrfID] = ss.[eventCrfID]
           , [crfVersionID] = ss.[crfVersionID]
           , [fieldValue] = ss.[fieldValue]
           , [hadQuery] = ss.[hadQuery]
           , [openQuery] = ss.[openQuery]
           , [fieldValueOrdinal] = ss.[fieldValueOrdinal]
		   , [orgSourceSystemID] = ss.[orgSourceSystemID]
		   , [FieldID] = ss.[FieldID]
	       , [createDate] = ss.[createDate] 
	       , [createdBy] = ss.[createdBy] 
		   , [subjectID] = ss.[subjectID]
WHEN NOT MATCHED THEN

INSERT (   [sourceSystemFieldDataID]
           ,[sourceSystemFieldDataLabel]
           ,[eventCrfID]
           ,[crfVersionID]
		   ,[subjectID]
           ,[fieldValue]
           ,[hadQuery]
           ,[openQuery]
           ,[fieldValueOrdinal]
		   ,[FieldID]
		   ,[orgSourceSystemID]
		   ,[createDate]
		   ,[createdBy])

VALUES (    ss.[sourceSystemFieldDataID]
           ,ss.[sourceSystemFieldDataLabel]
           ,ss.[eventCrfID]
           ,ss.[crfVersionID]
		   ,ss.[subjectID]
           ,ss.[fieldValue]
           ,ss.[hadQuery]
           ,ss.[openQuery]
           ,ss.[fieldValueOrdinal]
		   ,ss.[FieldID]
		   ,ss.[orgSourceSystemID]
		   ,ss.[createDate]
		   ,ss.[createdBy]);

PRINT CAST(@@ROWCOUNT AS VARCHAR(10))+ ' slowly changing tblCrfEventAnswers row(s) updated.'

--*************************************
--cleanup--****************************
--*************************************
UPDATE itmidw.tblCrfEventAnswers SET fieldValue =
CONVERT(VARCHAR(100), CONVERT(DATETIME,
 crfA.fieldValue
  ) ,101)
  FROM itmidw.tblCrfEventAnswers crfA
	INNER JOIN tblCrfFields f
		ON f.fieldID  = crfa.FieldID
	INNER JOIN itmidw.Tblcrf crf
		on crf.crfID = crfA.crfVersionID
	INNER JOIN itmidw.TblcrfFields crfF
		on crfF.fieldID = f.fieldID
WHERE 
crfF.datatype = 'DateTime'
and crfA.fieldValue <> ''
and (SUBSTRING(crfA.fieldValue,3,1) NOT IN (':') AND SUBSTRING(crfA.fieldValue,2,1) NOT IN (':') )
and ISDATE(
 crfA.fieldValue
) = 1

PRINT CAST(@@ROWCOUNT AS VARCHAR(10))+ 'Clean up of dates tblCrfEventAnswers row(s) updated.'

--*************************************
--**********Date cleanup**************
--*************************************
UPDATE itmidw.tblCrfEventAnswers SET fieldValue =
  CONVERT(VARCHAR(100),
  CONVERT(DATETIME,
  CASE SUBSTRING(crfa.FieldValue,4,3)
	WHEN 'JAN'  THEN '01'
	WHEN 'FEB'  THEN '02'
	WHEN 'MAR'  THEN '03'
	WHEN 'APR'  THEN '04'
	WHEN 'MAY'  THEN '05'
	WHEN 'JUN'  THEN '06'
	WHEN 'JUL'  THEN '07'
	WHEN 'AUG'  THEN '08'
	WHEN 'SEP'  THEN '09'
	WHEN 'OCT'  THEN '10'
	WHEN 'NOV'  THEN '11'
	WHEN 'DEC'  THEN '12'	
ELSE '' END 
 + '-' +
 LEFT(crfa.FieldValue,2) + '-' +
  SUBSTRING(crfa.FieldValue,8,4) 
 ),101)
from itmidw.tblcrfeventAnswers crfA
	INNER JOIN tblCrfFields f
		ON f.fieldID  = crfa.FieldID
	INNER JOIN itmidw.Tblcrf crf
		on crf.crfID = crfA.crfVersionID
	INNER JOIN itmidw.TblcrfFields crfF
		on crfF.fieldID = f.fieldID
where crfF.datatype = 'DateTime'
and crfA.fieldValue <> ''
and ISDATE(crfA.fieldValue) = 0
and ISDATE(
  CASE SUBSTRING(crfa.FieldValue,4,3)
	WHEN 'JAN'  THEN '01'
	WHEN 'FEB'  THEN '02'
	WHEN 'MAR'  THEN '03'
	WHEN 'APR'  THEN '04'
	WHEN 'MAY'  THEN '05'
	WHEN 'JUN'  THEN '06'
	WHEN 'JUL'  THEN '07'
	WHEN 'AUG'  THEN '08'
	WHEN 'SEP'  THEN '09'
	WHEN 'OCT'  THEN '10'
	WHEN 'NOV'  THEN '11'
	WHEN 'DEC'  THEN '12'	
ELSE '' END 
 + '-' +
 LEFT(crfa.FieldValue,2) + '-' +
